enum StatusNames {  saleApprovalDelivered,  salePendingApproval,  procesada,  confirmed,  pending,  current,  active,  pendingWholesalerReview,  inProcess,  verified,  rejected,  processed}StatusNames convertToStatusNames(String value) {  return StatusNames.values      .firstWhere((e) => e.toString() == 'StatusNames.' + value);}